// Example 14.3: Tests a queue import java.util.*;public class TestQueue{public static void main(String[] args){      // Create a queue of integers      Queue<Integer> queue = new LinkedList<Integer>();      // Add 5 integers to the queue      for (int i = 1; i <= 5; i++)         queue.add(i);      // Traverse the queue to print the elements      for (int i : queue)         System.out.println(i);      // Remove and print the element at the front      System.out.println(queue.remove());      // Try to replace the element at position 2 --- syntax error!      System.out.println(queue.set(2, 10));}}